import "./Admin.css";

import React from "react";
import Sidebar from "./Sidebar";
import SidebarButton from "./SidebarButton";
import { WrenchIcon, HomeIcon, CalculatorIcon } from "../../Global";

const Admin = () => {
	return (
		<div id="admin-page">
			<Sidebar id="side-bar">
				<SidebarButton icon={HomeIcon}>Qu </SidebarButton>
				<SidebarButton icon={CalculatorIcon}>Bill</SidebarButton>
				<SidebarButton icon={WrenchIcon}>Manage</SidebarButton>
			</Sidebar>
		</div>
	);
};

export default Admin;
